import React from "react";

function Navbar() {
    return ( <
        >
        <
        nav class = "navbar" >
        <
        h1 class = "logo" >
        <
        img src = "subhankar-logo.jpg"
        alt = "" / >
        <
        /h1> <
        ul class = "nav-links" >
        <
        li class = "active" >
        <
        a href = "#header" > Home < /a> <
        /li> <
        li >
        <
        a href = "#about-section" > About < /a> <
        /li> <
        li >
        <
        a href = "#services-container" > Course < /a> <
        /li> <
        li >
        <
        a href = "#gallery-section" > Gallery < /a> <
        /li> <
        li >
        <
        a href = "#contact-section" > Contact < /a> <
        /li> <
        /ul> <
        img src = "./menu.png"
        alt = ""
        class = "menu-btn" / >
        <
        /nav> <
        />
    );
}

export default Navbar;
